import React from "react";

import "./orders-card.styles.css";

const OrdersCard = ({ cartItems }) => {
  console.log("IRAR JAJAJA", cartItems);
  return (
    <div className="orderCard__container">
      <div className="orderCard__leftSide"></div>
      <div className="orderCard__rightSide"></div>
    </div>
  );
};

export default OrdersCard;
